import UCDInvoice from '../aggregatedFlows/UCDInvoice';
const UCDWaybill = {
    name: 'ucd_waybill',
    label: 'Универсальный корректировочный документ',
    type: 'local',
    aggregatedFlow: UCDInvoice
};
export default UCDWaybill;
